import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { UserService } from 'src/app/service/user.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})

export class LoginComponent {
  loginFormModel: any = {};
  email:string='';
  pass:string='';
  dbpass:string='';
  userValid:boolean=true;
  loginSuccessfull: boolean=true;
  constructor(private router: Router,private userService:UserService) { }

  login() {
    // Handle login logic and authentication
    // Redirect to user list page on successful login
    this.email = this.loginFormModel.email;
    this.pass = this.loginFormModel.password;

    const cred:{email:string, pass:string} = {email: this.email,pass: this.pass}
    this.userService.isAuthenticated(cred).subscribe(
      (value) => {
        console.log('hello',value);
        if(value.valid==null){
          this.userValid=false;
        }
        if(value.valid.isValid){
          this.userService.setToken(value.token)
          this.router.navigate(['/users']);

        }else{
          this.loginSuccessfull=false
          this.router.navigate(['/login'])
        }
      }
    )
  }
}
<div>
    <h2>Login</h2>
    <form (ngSubmit)="login()" #loginForm="ngForm">
        <div>
            <label for="email">Email:</label>
            <input type="email" id="email" name="email" [(ngModel)]="loginFormModel.email" required>
            <p *ngIf="!userValid">Incorrect username</p>
        </div>
        <div>
            <label for="password">Password:</label>
            <input type="password" id="password" name="password" [(ngModel)]="loginFormModel.password" required>
        </div>
        <button type="submit">Login</button>
        <br>
        <p *ngIf="!loginSuccessfull">Incorrect username or password</p>
    </form>
    <p>Not registered yet? <a routerLink="/register">Register</a></p>
</div>
